import React, { Component } from 'react';
import './Footer.css';
export default class Footer extends Component {
    render() {
        return (
            <div>
                <footer className="site-footer">
                    <div className="container">
                        <div className="row">
                            <div className="col-6 col-sm-3 m-auto ">
                                <a href="http://instagram.com/"><i class="bi bi-facebook"></i></a>
                                <a href="http://www.facebook.com/"><i class="bi bi-instagram"></i></a>
                                <a role="button" href="tel:+14109420001"><i class="bi bi-telephone-fill" /></a>
                                <a role="button" href="mailto:notreal@notreal.co"><i class="bi bi-envelope-fill"></i></a>
                            </div>
                        </div>
                    </div>
                </footer>

            </div>
        );
    }
}
